import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  render() {
    return (
      <Router>
        <Switch>
          <Route path='/' exact={true} component={Home} />
          <Route path='/postings/' exact={true} component={PostList} />
        </Switch>
      </Router>
    )
  }
}

export default App;
